import { BrowserRouter, Route, Routes } from "react-router-dom";
import { Header } from "../components/Header";
import Home from "../pages/Home";
import Login from "../pages/Login";
import Register from "../pages/Register";
//import Menu from "../pages/Menu";
//import Cart from "../pages/Cart";
//import PaymentSuccess from "../pages/PaymentSuccess";
import { useSelector } from "react-redux";
import { cartProducts } from "../stores/cart/cartSlice";
import { Footer } from "../components/Footer";
import Menu from "../pages/Menu/index";
import MenuItems from "../components/MenuItems";

const Navigation = () => {
    const productsInCart = useSelector(cartProducts);

    return (
        <BrowserRouter>
            <Header cartCount={productsInCart ? productsInCart.length : 0}/>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />
                <Route path="/Menu" element={<Menu />} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Beef" element={<MenuItems category="Beef"/>} />
                <Route path="/Dessert" element={<MenuItems category="Dessert"/>} />
                <Route path="/Lamb" element={<MenuItems category="Lamb"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                <Route path="/Chicken" element={<MenuItems category="Chicken"/>} />
                {/* <Route path="/cart" element={<Cart />} /> */}
                {/* <Route path="/payment-success" element={<PaymentSuccess />} /> */}
            </Routes>
            <Footer />
        </BrowserRouter>
    )
}

export default Navigation;
